import React from "react";

export default function Listbook(props) {
  console.log(props);
  return (
    <div class="card">
      <div class="card-header">Rating</div>
      <div class="card-body">
        <h5 class="card-title">{props.result[0].title}</h5>
        <p class="card-text">{props.result[0].author}</p>
      </div>
    </div>
  );
}
